import React, { useState } from 'react';
import { Popover, Typography } from '@mui/material';
import santosh from '../Assets/santosh.jpg';

const styles = {
    navbar: {
        backgroundColor: '#f8f9fa', // Light background
    },
    container: {
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: '0 15px',
    },
    toggle: (isChecked) => ({
        position: 'relative',
        width: '40px',
        height: '40px',
        cursor: 'pointer',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        gap: '10px',
        transition: 'transform .5s',
        transform: isChecked ? 'rotate(180deg)' : 'none',
    }),
    bars: {
        width: '100%',
        height: '4px',
        backgroundColor: 'rgb(176, 92, 255)',
        borderRadius: '4px',
        transition: 'transform .5s, width .5s',
    },
    bar1: (isChecked) => ({
        width: '70%',
        transform: isChecked ? 'rotate(45deg)' : 'none',
    }),
    bar2: (isChecked) => ({
        width: '70%',
        transform: isChecked ? 'scaleX(0)' : 'none',
    }),
    bar3: (isChecked) => ({
        width: '70%',
        transform: isChecked ? 'rotate(-45deg)' : 'none',
    }),
    roundedImage: {
        width: '40px',
        height: '40px',
        borderRadius: '50%',
    },
};

function Navbar() {
    const [isChecked, setIsChecked] = useState(false);
    const [anchorEl, setAnchorEl] = useState(null);
    const [isPopup, setIsPopup] = useState(false);
    const user = true;

    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
        setIsPopup(true);
    };

    const handleClose = () => {
        setAnchorEl(null);
        setIsPopup(false);
    };

    const id = isPopup ? 'simple-popover' : undefined;

    return (
        <div className='container'>
            <nav className="navbar navbar-expand-lg navbar-light" style={styles.navbar}>
                <div className="container-fluid" style={styles.container}>
                    <a className="navbar-brand" href="#">Navbar</a>
                    {/* Toggle Button */}
                    <input 
                        type="checkbox" 
                        id="checkbox" 
                        checked={isChecked} 
                        onChange={() => setIsChecked(prev => !prev)} 
                        style={{ display: 'none' }} 
                    />
                    <label 
                        htmlFor="checkbox" 
                        className="toggle" 
                        style={styles.toggle(isChecked)}
                    >
                        <div 
                            className="bars" 
                            id="bar1" 
                            style={styles.bar1(isChecked)}
                        ></div>
                        <div 
                            className="bars" 
                            id="bar2" 
                            style={styles.bar2(isChecked)}
                        ></div>
                        <div 
                            className="bars" 
                            id="bar3" 
                            style={styles.bar3(isChecked)}
                        ></div>
                    </label>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarNav">
                        <ul className="navbar-nav ms-auto d-flex gap-4 pe-5">
                            <li className="nav-item">
                                <a className="nav-link active" aria-current="page" href="#">Home</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link active" href="#">Jobs</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link active" href="#">Applications</a>
                            </li>
                        </ul>
                        {!user ? (
                            <div className='d-flex gap-4'>
                                <button className='btn btn-md bg-info'>Log In</button>
                                <button className='btn btn-md bg-secondary text-white'>Sign Up</button>
                            </div>
                        ) : (
                            <div>
                                <img 
                                    src={santosh} 
                                    alt="User" 
                                    className='rounded-circle' 
                                    style={styles.roundedImage} 
                                    aria-describedby={id} 
                                    onClick={handleClick} 
                                />
                                <Popover
                                    id={id}
                                    open={isPopup}
                                    anchorEl={anchorEl}
                                    onClose={handleClose}
                                    anchorOrigin={{
                                        vertical: 'bottom',
                                        horizontal: 'left',
                                    }}
                                >
                                    <Typography sx={{ p: 2 }}>The content of the Popover.</Typography>
                                </Popover>
                            </div>
                        )}
                    </div>
                </div>
            </nav>
        </div>
    );
}

export default Navbar;
